import React from 'react';
import Header from './components/Header'; // Adjust path if needed
import './App.css';

const App = () => {
  return (
    <div>
      <Header />
      <section id="about">
        <h2>About Me</h2>
        <p>Welcome to my portfolio!</p>
      </section>
      <section id="projects">
        <h2>Projects</h2>
        <p>Here are some of my projects.</p>
      </section>
      <section id="skills">
        <h2>Skills</h2>
        <p>These are my skills.</p>
      </section>
      <section id="contact">
        <h2>Contact</h2>
        <p>Contact me here!</p>
      </section>
    </div>
  );
};

export default App;
